import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the featured products grid (using ID selector)
    await page.waitForSelector('#productsGrid', { timeout: 5000 });

    // Select the first product card using a CSS selector
    const firstProductCard = await page.$('#productsGrid .product-card');
    if (!firstProductCard) {
      throw new Error('No product card found in featured products');
    }

    // Click the first product card to open the product detail modal
    await firstProductCard.click();

    // Wait for the product detail modal to appear (using ID selector)
    await page.waitForSelector('#productModal', { timeout: 5000 });

    // Wait for the "Add to Wish List" button inside the modal using button text
    const addToWishlistBtn = await page.waitForSelector(
      "//button[contains(normalize-space(), 'Add to Wish List')]",
      { timeout: 5000, state: 'visible' }
    );

    // Take screenshot before clicking "Add to Wish List"
    const beforeWishlistShot = path.join(screenshotsDir, 'step_2_product_modal.png');
    await page.screenshot({ path: beforeWishlistShot });
    screenshots.push(beforeWishlistShot);

    // Click the "Add to Wish List" button
    await addToWishlistBtn.click();

    // Wait for the notification to appear (using class and text)
    await page.waitForSelector(".notification.success", { timeout: 5000 });

    // Take screenshot after adding to wishlist
    const afterWishlistShot = path.join(screenshotsDir, 'step_3_added_to_wishlist.png');
    await page.screenshot({ path: afterWishlistShot });
    screenshots.push(afterWishlistShot);

    // Close the modal (find the close button by class and visible state)
    const closeBtn = await page.waitForSelector('#productModal .close', { timeout: 5000 });
    await closeBtn.click();

    // Go to the wishlist page by clicking the "Your Wish List" link (first visible occurrence)
    const wishlistLink = await page.waitForSelector("//a[contains(text(), 'Your Wish List')]", { timeout: 5000 });
    await wishlistLink.click();

    // Wait for the wishlist page to load (by heading text)
    await page.waitForSelector("//h2[contains(text(), 'Your Wish List')]", { timeout: 5000 });

    // Take screenshot of the wishlist page
    const wishlistPageShot = path.join(screenshotsDir, 'step_4_wishlist_page.png');
    await page.screenshot({ path: wishlistPageShot });
    screenshots.push(wishlistPageShot);

    // Extract the title of the first item in the wishlist
    const wishlistItemTitle = await page.$eval(
      '.wishlist-item .wishlist-title',
      el => el.textContent.trim()
    );

    return {
      success: true,
      action: "Added first featured product to wishlist and verified its presence in the wishlist page.",
      extractedData: {
        wishlistFirstItemTitle: wishlistItemTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
